import React from "react";
import styled from "styled-components";

const ButtonComponent = styled.button`
  outline: 0;
  height: 4rem;
  width: 20rem;
  border-radius: 20px;
  border: rgba(255, 255, 255, 0.514) 4px solid;
  background: none;
  color: white;
  font-size: 1.3rem;
  cursor: pointer;
`;

const Button = (props) => {
  return (
    <>
      <ButtonComponent onClick={console.log(hello)}>
        {props.value}
      </ButtonComponent>
    </>
  );
};

export default Button;
